  const [user, setUser] = useState(null);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login setUser={setUser} />} />
        {/* Geçici olarak sadece login sayfası var */}
      </Routes>
    </Router>
  );
}

export default App;
